(593, 'options_hhw_faq_0_faq_question', 'Do I have to book a class?', 'no'),
(594, '_options_hhw_faq_0_faq_question', 'field_5c331b86eba89', 'no'),
(595, 'options_hhw_faq_0_faq_answer', ' Most classes you can simply show up! However, you can reserve a bike for RPM via telephone on the day of a class. Bookings for Reformer Pilates are essential. You can book via the ‘MindBody’ booking app.', 'no'),
(596, '_options_hhw_faq_0_faq_answer', 'field_5c331c22eba8a', 'no'),
(597, 'options_hhw_faq_1_faq_question', 'Do I have to book the creche?', 'no'),
(598, '_options_hhw_faq_1_faq_question', 'field_5c331b86eba89', 'no'),
(599, 'options_hhw_faq_1_faq_answer', 'No! Just turn up and check your child/children in.', 'no'),
(600, '_options_hhw_faq_1_faq_answer', 'field_5c331c22eba8a', 'no'),
(601, 'options_hhw_faq_2_faq_question', 'Does my membership include access to the pool?', 'no'),
(602, '_options_hhw_faq_2_faq_question', 'field_5c331b86eba89', 'no'),
(603, 'options_hhw_faq_2_faq_answer', 'Yes. Members can access the heated 25m lap pool anytime the gym is open.', 'no'),
(604, '_options_hhw_faq_2_faq_answer', 'field_5c331c22eba8a', 'no'),
(605, 'options_hhw_faq_3_faq_question', ' As a member, can I bring my kids to the pool?', 'no'),
(606, '_options_hhw_faq_3_faq_question', 'field_5c331b86eba89', 'no'),
(607, 'options_hhw_faq_3_faq_answer', 'Yes! Members can bring their own children (age 0-14) for a small fee. After 14 year of age, we offer full membership to the club at student rates. ', 'no'),
(608, '_options_hhw_faq_3_faq_answer', 'field_5c331c22eba8a', 'no'),
(609, 'options_hhw_faq_4_faq_question', 'Can I suspend my membership?', 'no'),
(610, '_options_hhw_faq_4_faq_question', 'field_5c331b86eba89', 'no'),
(611, 'options_hhw_faq_4_faq_answer', 'Your membership can be suspended for a fee of $5 p/w. (Medical suspension is at no cost)', 'no'),
(612, '_options_hhw_faq_4_faq_answer', 'field_5c331c22eba8a', 'no'),
(613, 'options_hhw_faq_5_faq_question', 'Can I use other Healthworks centres?', 'no'),
(614, '_options_hhw_faq_5_faq_question', 'field_5c331b86eba89', 'no'),
(615, 'options_hhw_faq_5_faq_answer', ' Hendra members can use any other Healthworks Centre free of charge up to twice per week.', 'no'),
(616, '_options_hhw_faq_5_faq_answer', 'field_5c331c22eba8a', 'no'),
(617, 'options_hhw_faq_6_faq_question', 'How can I cancel my membership?', 'no'),
(618, '_options_hhw_faq_6_faq_question', 'field_5c331b86eba89', 'no'),
(619, 'options_hhw_faq_6_faq_answer', ' Memberships cannot be processed online or via phone. To cancel your membership, you must give 30 days’ notice, in club by way of Cancellation Form. No appointment is necessary, however a staff member must witness your signature. Cancellation forms cannot be faxed, emailed or otherwise obtained.', 'no'),
(620, '_options_hhw_faq_6_faq_answer', 'field_5c331c22eba8a', 'no'),
(621, 'options_hhw_faq_7_faq_question', ' Will someone show me how to use the gym when I join?', 'no'),
(622, '_options_hhw_faq_7_faq_question', 'field_5c331b86eba89', 'no'),
(623, 'options_hhw_faq_7_faq_answer', ' Yes! Healthworks Hendra provides a complimentary one on one session with a personal trainer for every new member that joins the club.', 'no'),
(624, '_options_hhw_faq_7_faq_answer', 'field_5c331c22eba8a', 'no'),
(625, 'options_hhw_faq_8_faq_question', 'Is tennis included in my membership?', 'no'),
(626, '_options_hhw_faq_8_faq_question', 'field_5c331b86eba89', 'no'),
(627, 'options_hhw_faq_8_faq_answer', 'Yes, Members play unlimited free tennis. If a member brings a friend or family member who is not a member of Healthworks Hendra, a fee of $12.50 applies.', 'no'),
(628, '_options_hhw_faq_8_faq_answer', 'field_5c331c22eba8a', 'no'),
