(631, 'options_hhw_faq_9_faq_answer', 'Reformer Pilates is for anyone looking to get lean, toned and fit - fast. Reset, readjust, restart and refocus to create a more balanced body in the newly renovated loft at Hendra Healthworks.', 'no'),
