(392, 516, '_form', '<div class=\"clear\">\n				<div class=\"half-col\">[text enquire_first_name class:text-box placeholder \"First Name\"]</div>\n				<div class=\"half-col\">[text enquire_last_name class:text-box placeholder \"Last Name\"]</div>\n			</div>\n			<div class=\"clear\">\n				<div class=\"half-col\">[email* enquire_email class:text-box placeholder \"Email Address\"]</div>\n				<div class=\"half-col\">[number* enquire_number class:text-box placeholder \"Contact Number\"]</div>\n			</div>\n			<div class=\"clear\">\n				<div class=\"full-col\">\n					<div class=\"custom-select\">\n[select* enquire_inquiring_about class:test include_blank \"membership : Membership \" \"free trail : Free Trail\" \"other : Other\"]\n					</div>\n				</div>\n			</div>\n			<div class=\"clear\">\n				<div class=\"full-col\">[text enquire_message class:text-box placeholder \"Message\"]</div>\n			</div>\n			<div class=\"clear\">\n                                [submit class:submit-btn \"Submit\"]\n                        </div>'),
